// SPDX-License-Identifier: MIT
pragma solidity ^0.8.2;

import "./CrossChainImplementationInterface.sol";
import "./Payment.sol";

contract CrossChainImplementation is CrossChainImplementationInterface, Payment{

    function version() public pure returns(string memory) {
        return "0.2.0";
    }

    constructor(){}

    function mintFee(uint256 targetChainId) public view returns(uint256){
        return _mintFee(targetChainId);
    }
    
    function redeemFee(uint256 targetChainId) public view returns(uint256){
        return _redeemFee(targetChainId);
    }

    
    function requestTransferCrossChain(
        uint256 targetChainId,
        address to,
        uint256 chainId,
        address contAddr,
        uint256 tokenId,
        string memory uri,
        address dappAddr,
        bytes memory data
    ) public payable {
        _payMintFee(msg.value, targetChainId, dappAddr);
    }

    function requestReleaseLockedToken(
        uint256 chainId,
        address contAddr,
        address to,
        uint256 tokenId,
        address dappAddr,
        bytes memory data
    ) public payable{
        _payRedeemFee(msg.value, chainId, dappAddr);
    }
}

// SPDX-License-Identifier: MIT
pragma solidity ^0.8.2;

interface CrossChainImplementationInterface {
    
    function requestTransferCrossChain(
        uint256 targetChainId,
        address to,
        uint256 chainId,
        address contAddr,
        uint256 tokenId,
        string memory uri,
        address dappAddr,
        bytes memory data
    ) external payable;

    function requestReleaseLockedToken(
        uint256 chainId,
        address contAddr,
        address to,
        uint256 tokenId,
        address dappAddr,
        bytes memory data
    ) external payable;

    function mintFee(uint256 targetChainId) external view returns(uint256);
    
    function redeemFee(uint256 targetChainId) external view returns(uint256);
}

